import React from "react";

export default function Socials() {
  return (
    <body>
      <h1>About Me</h1>
      <p>
        I first graduated around 2014 with a associates degree in Animation /
        SFX. Realizing before I took my degree any further that this was not the
        profession for me I went into sales work. Leading a sales team through
        CDS I had a chance to reflect on what I wanted to do. I went back to
        school and got an associates in Software Development. After graduating a
        spent the next year+ studying frameworks and reviewing what I had
        learned. I knew I wanted to go into full-stack web development so I
        focused my study on reviewing Javascript / Html / Css / Php / and MySQL.
        My framework study lead me to work with Mongodb / Express / react /
        node.
      </p>
    </body>
  );
}
